import React, { useEffect, useState } from 'react';
import axios from 'axios';
import swal from 'sweetalert';
import { Link, useNavigate, useParams } from 'react-router-dom';

function Product() {
    const navigate = useNavigate();
    const { product_id } = useParams();
    const [productInput, setProduct] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState([]);

    useEffect(() => {
        axios.get(`/api/select-category`).then(res => {
            if (res.data.status === 200) {
                setSelectedCategories(res.data.categories);
            }
        });
        axios.get(`/api/get-product/${product_id}`).then(res => {
            if (res.data.status === 200) {
                setProduct(res.data.product);
            } else if (res.data.status === 404) {
                swal("Error", res.data.message, "error");
                navigate('/admin/products');
            }
        });
        setLoading(false);
    }, []);

    const handleInput = (e) => {
        e.persist();
        setProduct({...productInput, [e.target.name]: e.target.value})
    }

    const updateProduct = (e) => {
        e.preventDefault();
        
        const data = productInput;

        axios.put(`/api/update-product/${product_id}`, data).then(res => {
            if (res.data.status === 200) {
                swal("Success", res.data.message, "success");
            } else if (res.data.status === 404) {
                swal("Error", res.data.message, "error");
                navigate('/admin/products');
            } else if (res.data.status === 422) {
                setError(res.data.errors);
            }
        });
    }

    if (loading) {
        return <h4>Loading...</h4>
    }

    return (
        <div className='container-fluid px-4'>
            <div className="card mt-4">
                <div className="card-header">
                    <h4>Uredi kategoriju <Link to="/admin/products" className="btn btn-primary btn-sm float-end">Natrag</Link></h4>
                </div>
                <div className="card-body">
                    <form onSubmit={updateProduct}>
                        <ul className="nav nav-tabs" id="myTab" role="tablist">
                        <li className="nav-item" role="presentation">
                            <button className="nav-link active" id="home-tab" data-bs-toggle="tab" data-bs-target="#home-tab-pane" type="button" role="tab" aria-controls="home-tab-pane" aria-selected="true">Home</button>
                        </li>
                        <li className="nav-item" role="presentation">
                            <button className="nav-link" id="profile-tab" data-bs-toggle="tab" data-bs-target="#seo-tags" type="button" role="tab" aria-controls="seo-tags" aria-selected="false">SEO Tags</button>
                        </li>
                        </ul>
                        <div className="tab-content" id="myTabContent">
                            <div className="tab-pane card-body border fade show active" id="home-tab-pane" role="tabpanel" aria-labelledby="home-tab" tabIndex="0">
                                <div className="form-group mb-3">
                                    <label>Naziv</label>
                                    <input type="text" name="name" onChange={handleInput} value={productInput.name} className="form-control" />
                                </div>
                                <div className="form-group mb-3">
                                    <label>Opis</label>
                                    <textarea name="description" onChange={handleInput} value={productInput.description} className="form-control"></textarea>               
                                </div>
                                <div className="form-group mb-3">
                                    <label>Aktivno</label>
                                    <input type="checkbox" name="active" onChange={handleInput} value={productInput.active}/>               
                                </div>
                            </div>
                            <div className="tab-pane card-body border fade show active" id="seo-tags" role="tabpanel" aria-labelledby="home-tab" tabIndex="0">
                            </div>
                        </div>

                        <button type="submit" className="btn btn-primary px-4 float-end">Spremi promjene</button>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default Product;
